    [],nt"num_tags": 10,nt"name": "delmarva-fox-squirrel-recovery-plan-1979",nt"isopen":
    false,nt"url": null,nt"notes": "The primary objective of the Recovery Plan
    is to restore the Delmarva fox squirrel to secure status throughout its former range,
    which is described in this plan. The plan includes the following actions to attain
    this objective: 1) Preservation and management of essential denning and feeding
    habitat; 2) Trans location of squirrels into suitable designated habitats where
    they are now absent; 3) Protection of  squirrel populations through law enforcement,
    and; 4) Promotion of public support and understanding.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
